import AppRoutes from "./routes/AppRoutes";
import './App.css';
import SignIn from "./components/SignIn";

function App() {

  const token = null;

  if (!token) {
    return <SignIn />
  }

  return (
    <div className="App">
      <BrowserRouter>
        <AppRoutes />
      </BrowserRouter>
    </div>
  );
}

export default App;
